import logo from './logo.svg';
import './App.css';
import ClienteSergio from "./componentes/Cliente"
import MenuPpal from "./componentes/Menu"
import {BrowserRouter, Route, Routes} from "react-router-dom"
function App() {
  return (
    <div className="App">
      <header className='App-header'>
        <MenuPpal/>
      </header>
      <BrowserRouter>
      <Routes>
      <Route path="/cliente" element={<ClienteSergio />} />

      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
